// src/components/PatientList.js
import { useEffect, useState } from 'react';
import { getPacientes } from '../utils/database';

export default function PatientList() {
  const [pacientes, setPacientes] = useState([]);

  useEffect(() => {
    const loadPacientes = async () => {
      const data = await getPacientes();
      setPacientes(data);
    };
    loadPacientes();
  }, []);

  return (
    <div className="p-4">
      <h2 className="text-xl font-bold mb-4">Pacientes Registrados</h2>
      <div className="space-y-2">
        {pacientes.length > 0 ? (
          pacientes.map((paciente) => (
            <div key={paciente.id} className="p-3 border rounded-lg">
              <h3 className="font-semibold">{paciente.nombre}</h3>
              <p>Edad: {paciente.edad} a√±os</p>
              <p className="text-sm text-gray-600">{paciente.diagnostico}</p>
            </div>
          ))
        ) : (
          <p>No hay pacientes registrados.</p>
        )}
      </div>
    </div>
  );
}
